var anshunxu = arguments[0];

function getBase64Image(arg1){

    var miaoshu = arguments[0];//参数
	if(!miaoshu)
	{
		var el =document.querySelector("body > div.wrap.captcha-wrap > div.captcha-title");
		if(el){
			miaoshu = el.textContent;
		}else{
			miaoshu = "按顺序点击：";
		}
	}

    var smallImg =document.querySelector("body > div.wrap.captcha-wrap > div.captcha-title > img");//小图片
    var bigImg = document.querySelector("body > div.wrap.captcha-wrap > div.captcha-opera > div > div:nth-child(1) > img")//大图片


    //
    var cwidth =  bigImg.width;//宽
    var cheight = bigImg.height +smallImg.height;//高

    var canvas = document.createElement("canvas");//创建一个canvas

    canvas.width = cwidth; // 设置对应的宽高
    canvas.height = cheight;

	;


    var ctx = canvas.getContext("2d"); // 二维绘图环境
	ctx.fillStyle= "White"  ;
	//设置背景
	//ctx.fillStyle="#FFFFFF";
    ctx.fillRect(0,0,canvas.width,canvas.height);
    ctx.fillStyle="#000000"

    ctx.drawImage(bigImg, 0, 0, bigImg.width, bigImg.height); // 将图片画在画布上

	//描述加在后边 就不用转坐标了

	//画小图片
    ctx.drawImage(smallImg, 0, bigImg.height, smallImg.width, smallImg.height); 

	//绘制描述文本 在小图后面 这样就不用算图片宽度

    ctx.font="20px Arial";
    ctx.fillText(miaoshu,smallImg.width+10,bigImg.height+22);//绘制在画布相对坐标的位置

    var ext = bigImg.src.substring(bigImg.src.lastIndexOf(".") + 1).toLowerCase(); // 获取到图片的格式
    var dataURL = canvas.toDataURL("image/" + ext); // 得到base64 编码的 dataURL
    return dataURL;
}
var imgbase64srt= getBase64Image(anshunxu);
return imgbase64srt;

