function getBase64Image(arg1){
    //var miaoshu = document.getElementsByClassName("tcaptcha-title")[0].innerText;  由于是在框架里面 document 切不到指定框架,获取不到指定内容 只能传参数
    var miaoshu = arguments[0];//参数
    var img = document.querySelector("#tcaptcha-img");//document.getElementById("tcaptcha-img"); 

    var canvas = document.createElement("canvas");// 创建一个canvas
    canvas.width = img.width; // 设置对应的宽高
    canvas.height = img.height;
    var ctx = canvas.getContext("2d"); // 二维绘图环境
    ctx.drawImage(img, 0, 0, img.width, img.height); // 将图片画在画布上
    //绘制描述文本
    ctx.font="20px Arial";
    ctx.fillText(miaoshu,10,25);

    var ext = img.src.substring(img.src.lastIndexOf(".") + 1).toLowerCase(); // 获取到图片的格式
    var dataURL = canvas.toDataURL("image/" + ext); // 得到base64 编码的 dataURL
    return dataURL;
}
var imgbase64srt= getBase64Image(miaoshuarg);
return imgbase64srt;

